class Solution:
    def maxOperations(self, s: str) -> int:
        reduce_zeros = []
        for i in s:
            if i == "1" or len(reduce_zeros) == 0 or reduce_zeros[-1] == "1":
                reduce_zeros.append(i)
        # print(reduce_zeros)
        zeros_after = 0
        ans = 0 
        for i in reduce_zeros[::-1]:
            if i == "0":
                zeros_after += 1
                # print("see 0")
            if i == "1":
                ans+=zeros_after
                # rint(zeros_after)
        return ans
